import {Row, Col} from 'antd';
import '../styles/EditMentors.css'

const EditMentors  = () => {

  return (
    <>
      <Row className='editMentors'>
        <Col span={12} id='boxMentors'>
          <h1>Delete Mentor</h1>
        </Col>
        <Col span={12} id='boxMentors'>
          <h1>Add Mentor</h1>
        </Col>
      </Row>
    </>
  );  
}

export default EditMentors;
